import { data } from "./Data/TodoListData"
import Task from "./Task";
import './Note.css';

function Note() {
    console.log(data[0])
    console.log(data[0].date)


    return (
        <>
            <div className="note-container ">


                <div>
                    <div style={{}}>
                        <Task />
                    </div>

                    <div className="agent" > Agent </div>

                </div>

                <div className="analysis" >
                    <div>
                        <p> analysis here </p>
                    </div>
                </div>

            </div>

        </>
    );
}

export default Note;
